import numpy as np
import pandas as pd
import scipy.stats as stats
import matplotlib.pyplot as plt

"""**Рассчитать точечные оценки математического ожидания и стандартного отклонения**"""

with open('1.txt', 'r') as file:
    data1 = file.readlines()

# Преобразование строк в числа с удалением лишних символов, таких как перенос строки
data1 = [float(x.strip()) for x in data1]

plt.figure(figsize=(8, 6))
plt.hist(data1, bins=30, density=True, alpha=0.5, color='skyblue', edgecolor='black')
plt.title('Histogram of Data')
plt.xlabel('Values')
plt.ylabel('Density')
plt.grid(True)
plt.show()

mean_data1 = np.mean(data1)
sd_data1 = np.std(data1)
print(mean_data1, sd_data1)

"""**Найти границы доверительного интервала мат. ожидания по правилу нормального
распределения, используя таблицу критических значений функции Лапласа**
"""

gamma = 0.95
interval_norm1 = mean_data1 + np.array([-1, 1]) * 1.96 * sd_data1 / np.sqrt(len(data1))
print("Доверительный интервал нормального распределения:", interval_norm1)

"""**По правилу t-распределения Стьюдента, используя таблицу
критических значений 𝑡𝛾,𝑛 t-распределения при значении
уверенности 𝛾 = 0.95**
"""

interval_stud1 = mean_data1 + stats.t.interval(gamma, len(data1) - 1, loc=0, scale=sd_data1 / np.sqrt(len(data1)))
print("Доверительный интервал t-распределения Стьюдента:", interval_stud1)

"""**Найти границы доверительного интервала для среднеквадратического
отклонения по оценке 𝜒
2
-распределения при значении уверенности 𝛾 =
0.95**
"""

interval_sd1 = sd_data1 * np.sqrt(len(data1) - 1) / np.sqrt(stats.chi2.ppf([1-gamma/2, gamma/2], len(data1) - 1))
print("Доверительный интервал стандартного отклонения:", interval_sd1)

